window.bookSummaryJSON = "<p>A good captain protects his crew. Who protects the captain? </p> <p>A shuffling of cabins puts Ishmael Horatio Wang in command of the worst ship in the fleet. He learns that being captain doesn't make you infallible and that life in the captain's cabin is filled with new kinds of challenges as he tries to keep the ship moving, the crew out of trouble, and turn a profit to earn his Captain's Share. </p> <p>In a ship where the officers outnumber the crew, can he keep everybody happy? Welcome to the <i>SC Agamemnon</i>. </p>"; 
